#Part2
finalcount = 0
eclArray = ["amb","blu","brn","gry","grn","hzl","oth"]

for ArrayPos in range(0, len(array)):
    array[ArrayPos] = array[ArrayPos].split(" ")
    for ArrayPos2 in range(0, len(array[ArrayPos])):
        array[ArrayPos][ArrayPos2] = array[ArrayPos][ArrayPos2].split(":")

for ArrayPos in range(0, len(array)):
    #for every passport
    valid = 0
    for ArrayPos1 in range(0, len(array[ArrayPos])):
        #for every element
        element = array[ArrayPos][ArrayPos1][0]
        value = array[ArrayPos][ArrayPos1][1]
        if element == "byr":
            if len(value) == 4:
                value = int(value)
                if value >= 1920 and value <= 2002:
                    valid += 1
        if element == "iyr":
            if len(value) == 4:
                value = int(value)
                if value >= 2010 and value <= 2020:
                    valid += 1
        if element == "eyr":
            if len(value) == 4:
                value = int(value)
                if value >= 2020 and value <= 2030:
                    valid += 1
        if element == "hgt":
            if "cm" in value:
                value = value.strip("cm")
                value = int(value)
                if value >= 150 and value <= 193:
                    valid += 1
            elif "in" in value:
                value = value.strip("in")
                value = int(value)
                if value >= 59 and value <= 79:
                    valid += 1
        if element == "hcl":
            if len(value) == 7:
                if value[0] == "#":
                    if not "ghijklmnopqrstuvwxyz" in value:
                        valid += 1
        if element == "ecl":
            for eclColor in eclArray:
                if eclColor in value:
                    valid += 1
                    break
        if element == "pid":
            if len(value) == 9:
                valid += 1
    if valid == 7:
        if totalValid[ArrayPos]:
            finalcount += 1

print(finalcount)





